import React from "react";

class connectionExample extends React.Component {
  componentDidMount() {
    const apiUrl = 'https://127.0.0.1:8000/django/api/';
    fetch(apiUrl)
        .then((response) => response.json())
        .then((data) => console.log(data));
  }

  render() {
  }
}
